import React from "react";
import "./Home.css";
import ThisWeek from "../components/Homepage/ThisWeek";
import Hours from "../components/Homepage/Hours";

const Home: React.FC = () => {
  const completedDays = ["Sun", "Mon", "Tue", "Thu"];

  const hoursData = [
    { day: "Sun", hours: 5 },
    { day: "Mon", hours: 2 },
    { day: "Tue", hours: 3 },
    { day: "Wed", hours: 2 },
    { day: "Thu", hours: 5 },
    { day: "Fri", hours: 2 },
    { day: "Sat", hours: 2 },
  ];

  const totalHours = hoursData.reduce((sum, day) => sum + day.hours, 0);

  return (
    <div className="App">
      <ThisWeek completedDays={completedDays} />
      <Hours hoursData={hoursData} totalHours={totalHours} />
    </div>
  );
};

export default Home;
